import React from "react";

import Footer from "../Footer/Foot";
import Products from "../Products.jsx/Products";
import ProductData from "../Data/ProductData";
import Form from "react-bootstrap/Form";
import Accordion from "react-bootstrap/Accordion";

function Cars() {
  const productElement = ProductData.map((item) => {
    return (
      <Products
        key={item.id}
        img={item.img}
        price={item.price}
        engine={item.engine}
        fuel={item.fuel}
        hspwr={item.horsepower}
        mileage={item.mileage}
      />
    );
  });
  return (
    <>
      <div className="container pt-5">
        <div className="row">
          <div className="col-md-3" style={{ backgroundColor: "grey" }}>
            <Form>
              <Form.Group className="m-3">
                <Form.Label>Model</Form.Label>
                <Form.Control type="text" placeholder="Enter Model" />
              </Form.Group>
            </Form>
            <hr className="mt-4 mb-3" />
            <Accordion>
              <Accordion.Item eventKey="0">
                <Accordion.Header>Accordion Item #1</Accordion.Header>
                <Accordion.Body>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  do eiusmod tempor incididunt ut labore et dolore magna aliqua.
                  Ut enim ad minim veniam, quis nostrud exercitation ullamco
                  laboris nisi ut aliquip ex ea commodo consequat. Duis aute
                  irure dolor in reprehenderit in voluptate velit esse cillum
                  dolore eu fugiat nulla pariatur. Excepteur sint occaecat
                  cupidatat non proident, sunt in culpa qui officia deserunt
                  mollit anim id est laborum.
                </Accordion.Body>
              </Accordion.Item>
              <Accordion.Item eventKey="1">
                <Accordion.Header>Accordion Item #2</Accordion.Header>
                <Accordion.Body>
                  Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed
                  do eiusmod tempor incididunt ut labore et dolore magna aliqua.
                  Ut enim ad minim veniam, quis nostrud exercitation ullamco
                  laboris nisi ut aliquip ex ea commodo consequat. Duis aute
                  irure dolor in reprehenderit in voluptate velit esse cillum
                  dolore eu fugiat nulla pariatur. Excepteur sint occaecat
                  cupidatat non proident, sunt in culpa qui officia deserunt
                  mollit anim id est laborum.
                </Accordion.Body>
              </Accordion.Item>
            </Accordion>
            <hr className="mt-4 mb-3" />
          </div>
          <div
            className="col-md-8 offset-md-1"
            style={{ backgroundColor: "grey" }}
          >
            <div
              className="row justify-content-center"
              style={{ maxWidth: "1300px" }}
            >
              {productElement}
            </div>
          </div>
        </div>
      </div>

      <div className="container-fluid d-flex justify-content-center">
        <div className="row mt-4 p-3" style={{ maxWidth: "1300px" }}>
          {productElement}
          <Footer />
        </div>
      </div>
    </>
  );
}
export default Cars;
